INSERT INTO `phimcongchieu` (`id_phim`, `ten_phim`, `daodien_phim`, `namsx_phim`, `nuocsx_phim`, `ghichu`, `img`) VALUES
(1, 'Gái già lắm chiêu 3', 'Bảo Nhân, NamCito', '2020', 'Việt Nam', 'Gái Già Lắm Chiêu phần ba xoay quanh câu chuyện về một gia tộc siêu giàu, trong đấy nàng dâu Ninh Dương Lan Ngọc tiếp tục là tâm điểm với vai cô con dâu siêu chảnh. Miss Q lắm tai tiếng của showbiz sẽ bước vào hào môn xứ Huế và đối đầu với mẹ chồng tương lai - cựu minh tinh nổi tiếng Thái Tuyết Mai.', );
INSERT INTO `phimcongchieu` (`id_phim`, `ten_phim`, `daodien_phim`, `namsx_phim`, `nuocsx_phim`, `ghichu`, `img`) VALUES
(2, 'Bố Già', 'Trấn Thành, Vũ Ngọc Đãng', '2021', 'Việt Nam', 'Bố già là câu chuyện thường nhật về một gia đình ở một xóm lao động nghèo tại thành phố Hồ Chí Minh. Tính của Bố già thì cần kiệm còn người con tên Quắn có phần bốc đồng, nông nổi, có thể mua chiếc quần hay đôi giày giá hơn 10 triệu đồng. Ông hay bao đồng, thường can thiệp vào chuyện láng giềng và cố gắng giúp đỡ tất cả mọi người xung quanh, còn Quắn thì cho rằng mỗi người có một cuộc sống riêng. Dù yêu thương nhau nhưng khoảng cách giữa các thế hệ đã dẫn đến những mâu thuẫn cha con nảy sinh.', );
INSERT INTO `phimcongchieu` (`id_phim`, `ten_phim`, `daodien_phim`, `namsx_phim`, `nuocsx_phim`, `ghichu`, `img`) VALUES
(3, 'Đêm tối rực rỡ', 'Aaron Toronto', '2022', 'Việt Nam', 'Trong đám tang của một gia đình, khi tất cả các thành viên có mặt đầy đủ thì cũng là lúc những bí mật của từng người được hé lộ. Mâu thuẫn xoay quanh chuyện vợ chồng, tranh chấp gia tài, nợ nần rồi sẽ được giải quyết ra sao?', );
INSERT INTO `phimcongchieu` (`id_phim`, `ten_phim`, `daodien_phim`, `namsx_phim`, `nuocsx_phim`, `ghichu`, `img`) VALUES
(4, 'Nghề siêu dễ', 'Võ Thanh Hoài', '2022', 'Việt Nam', 'Ông Thái là cảnh sát về hưu nhưng vẫn nhớ nghề, hàng ngày thường tìm bắt tội phạm vặt trong xóm. Một ngày kia, Hoàng - tên trùm ma túy mới ra tù bỗng dưng chuyển đến xóm ông và mở một văn phòng bất động sản. Nghi ngờ đây là nơi làm ăn phi pháp, ông Thái quyết định âm thầm điều tra. Ông mua lại tiệm cơm tấm đối diện trụ sở của Hoàng để làm nơi theo dõi, đồng thời thu nạp Thu - Phú - Vinh - Mèo, đám thanh niên “bất hảo” trong xóm về quán hỗ trợ buôn bán để rảnh tay \"phá án\". Trớ trêu thay, tiệm cơm bất ngờ nổi tiếng và ăn nên làm ra, khiến cho \"chuyên án đặc biệt\" của ông đứng trước nguy cơ đổ bể.', );
INSERT INTO `phimcongchieu` (`id_phim`, `ten_phim`, `daodien_phim`, `namsx_phim`, `nuocsx_phim`, `ghichu`, `img`) VALUES
(5, 'Bẫy ngọt ngào', 'Đinh Hà Uyên Thư', '2022', 'Việt Nam', 'Bẫy ngọt ngào xoay quanh câu chuyện về một hội bạn thân thiết có tên là \"hội ế\" gồm có Camy, Linh Đan, Ken và Quỳnh lam. Bọn họ đã nhiều năm xa cách không gặp nhau chỉ vì mỗi người đều phải lo cho sự nghiệp và cuộc sống tương lai của mình. Tuy nhiên, 3 năm sau, Camy tổ chức lễ kỉ niệm đám cưới và cả nhóm có cơ hội được gặp lại nhau. Nhưng từ đây, mỗi người trong nhóm đều phải đối mặt với những khó khăn, sóng gió trong cuộc sống của mình ở tương lai.', );

